import React from 'react';

import {
    Link
} from 'react-router-dom'

import {Button} from "@material-ui/core";

function MainPage() {

    return (
        <div>
            Main Page

            {/*todo: can update history directly */}
            <Button
                onClick = {() => this.props.history.push('/projects')}
            >
                Go to Projects
            </Button>
        </div>
    );
}

export default MainPage;


